import React, { Component } from "react";
import QuizComponent from "../QuizComponent/QuizComponent";

class Quiz extends Component {
  constructor(props) {
    super(props);
    this.state = {
      pyetjet: [
        {
          id: 1,
          pyetja: "Niagara eshte ujvara me e larta ne bote",
          pergjigja: false,
        },
        {
          id: 2,
          pyetja: "Pavarsia e Kosoves eshte me 17 shkurt ",
          pergjigja: true,
        },
      ],
    };
  }

  render() {
    return (
      <div>
        <div>
          <QuizComponent />
          <div>
            <button>Sakte</button>
            <button>Pasakte</button>
          </div>
          <p>Total te qelluara</p>
          <button>Rifillo</button>
          <div>
            <p>Pytje Aktuale:4/10</p>
            <p>Total Pyetje:10</p>
          </div>
          <div>Progres bar</div>
        </div>
      </div>
    );
  }
}

export default Quiz;
